def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    ratios = item / bins
    priorities = np.zeros_like(bins)

    for i in range(len(bins)):
        if ratios[i] < 0.25:
            priorities[i] = np.power(np.sin(item) + np.cos(bins[i]), 2) * np.cos(item) + np.sin(bins[i])
        elif ratios[i] >= 0.25 and ratios[i] < 0.5:
            priorities[i] = np.tan(item) + np.tan(bins[i]) * np.log(item) + np.log(bins[i])
        elif ratios[i] >= 0.5 and ratios[i] < 0.75:
            priorities[i] = np.log(np.abs(item - bins[i]) + 1) + np.sqrt(np.abs(item - bins[i]))
        elif ratios[i] >= 0.75 and ratios[i] < 1:
            priorities[i] = np.arctan(np.sqrt(item * bins[i])) * np.tanh(np.sqrt(item * bins[i]))
        else:
            priorities[i] = np.cosh(np.exp(ratios[i])) * np.tanh(np.sqrt(ratios[i])) - np.log(ratios[i] + 1) * np.exp(ratios[i])

    for j in range(len(bins)):
        if priorities[j] < 15:
            priorities[j] *= 4
        elif priorities[j] >= 15 and priorities[j] < 30:
            priorities[j] *= 5
        elif priorities[j] >= 30 and priorities[j] < 45:
            priorities[j] /= 3
        else:
            priorities[j] = np.sqrt(priorities[j]) + 10

    for k in range(len(bins)):
        if priorities[k] % 3 == 0:
            priorities[k] += item * 2
        else:
            priorities[k] -= item / 3

    return priorities
